        }
    }

    componentDidMount() {

    }

    handleSubmit(){
        console.log('submit');
    }

    getDataForPdf = (e) => {

        this.setState({ res: [... this.state.res, e] })
    }

    render(){
        console.log(this.state.res);

        return(
            <div>
            <form onSubmit={this.handleSubmit}>
                <FinalForm getDataForPdf={this.getDataForPdf.bind(this)} />
            <div className="text-center">
            <input type="submit" value="Submit" />
            </div>
            </form>

            </div>
        )
    }
}
